import React from "react";
import {
    CardBody,
    CardTitle,
    CardSubtitle,
    Card,
    Table,
} from "reactstrap";
import {useSelector} from "react-redux";
import moment from "moment";



const WorkoutWeekTable = ({workouts}) => {

    const currentWeek = useSelector(state => state.currentWeek)

    const currentWeekDays = currentWeek.map(d => moment(d).format('ddd'))
    console.log(currentWeekDays)

    return (
        <div>
            {currentWeek.map(d => createDayCard())}
        </div>
    )
};

const createDayCard = () => {
    return (
        <Card>
            <CardTitle>{}</CardTitle>
            <CardSubtitle>Push</CardSubtitle>
            <CardBody>
                <Table>
                    <thead>
                    <tr>
                        <th>Exercise</th>
                        <th>Reps</th>
                        <th>Sets</th>
                        <th>Achieved</th>
                    </tr>
                    </thead>
                    <tbody>
                    {/*workout content*/}
                    </tbody>
                </Table>
            </CardBody>
        </Card>
    )
};


export default WorkoutWeekTable;
